// src/components/TimesheetEntry.js

import React, { useState, useEffect } from 'react';
import api from '../services/api';

const TimesheetEntry = () => {
  const [projects, setProjects] = useState([]);
  const [subprojects, setSubprojects] = useState([]);
  const [formData, setFormData] = useState({
    projectId: '',
    subprojectId: '',
    jiraId: '',
    taskDescription: '',
    hoursSpent: '',
    comments: ''
  });
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchProjects();
  }, []);

  const fetchProjects = async () => {
    try {
      const response = await api.get('/projects');
      setProjects(response.data);
      setIsLoading(false);
    } catch (err) {
      setError('Failed to fetch projects. Please try again.');
      setIsLoading(false);
    }
  };

  const fetchSubprojects = async (projectId) => {
    if (!projectId) {
      setSubprojects([]);
      return;
    }
    try {
      setIsLoading(true);
      const response = await api.get(`/subprojects/${projectId}`);
      setSubprojects(response.data);
      setIsLoading(false);
    } catch (err) {
      setError('Failed to fetch subprojects. Please try again.');
      setIsLoading(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevData => ({ ...prevData, [name]: value }));

    if (name === 'projectId') {
      setFormData(prevData => ({ ...prevData, subprojectId: '' })); // Reset subproject selection
      fetchSubprojects(value);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post('/timesheet', formData);
      alert('Timesheet entry submitted successfully!');
      // Reset form or redirect as needed
      setFormData({
        projectId: '',
        subprojectId: '',
        jiraId: '',
        taskDescription: '',
        hoursSpent: '',
        comments: ''
      });
    } catch (err) {
      setError('Failed to submit timesheet. Please try again.');
    }
  };

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="projectId">Project:</label>
        <select
          id="projectId"
          name="projectId"
          value={formData.projectId}
          onChange={handleInputChange}
          required
        >
          <option value="">Select Project</option>
          {projects.map(project => (
            <option key={project.project_id} value={project.project_id}>
              {project.project_id} - {project.project_name}
            </option>
          ))}
        </select>
      </div>

      <div>
        <label htmlFor="subprojectId">Subproject:</label>
        <select
          id="subprojectId"
          name="subprojectId"
          value={formData.subprojectId}
          onChange={handleInputChange}
          required
          disabled={!formData.projectId}
        >
          <option value="">Select Subproject</option>
          {subprojects.map(subproject => (
            <option key={subproject.subproject_id} value={subproject.subproject_id}>
              {subproject.subproject_id} - {subproject.subproject_name}
            </option>
          ))}
        </select>
      </div>

      <div>
        <label htmlFor="jiraId">Jira ID:</label>
        <input
          type="text"
          id="jiraId"
          name="jiraId"
          value={formData.jiraId}
          onChange={handleInputChange}
          required
        />
      </div>

      <div>
        <label htmlFor="taskDescription">Task Description:</label>
        <textarea
          id="taskDescription"
          name="taskDescription"
          value={formData.taskDescription}
          onChange={handleInputChange}
          required
        />
      </div>

      <div>
        <label htmlFor="hoursSpent">Hours Spent:</label>
        <input
          type="number"
          id="hoursSpent"
          name="hoursSpent"
          value={formData.hoursSpent}
          onChange={handleInputChange}
          step="0.5"
          min="0"
          required
        />
      </div>

      <div>
        <label htmlFor="comments">Comments:</label>
        <textarea
          id="comments"
          name="comments"
          value={formData.comments}
          onChange={handleInputChange}
        />
      </div>

      <button type="submit">Submit Timesheet</button>
    </form>
  );
};

export default TimesheetEntry;
